      var barrier_img = _this.gameMain.game.barrier_img1; // контейнер с преградами
      //	_this.gameMain.game.barrier1.alpha = 0;
      
      var level = _this.gameMain.game.level; // контйнер с уровнем графика
      var level_count = 0;
      var btnTapGame = _this.gameMain.btnTapGame; // тап на управление дракном
      var drakon = _this.gameMain.drakon; // дракон
