      var plashka_info = _this.gameMain.plashka_info // плашка и инфой о статусе игры
      var scoope_point_text = _this.gameMain.scoope_point; // счетчик
      var scoope_point = 0; // количество очков
      var scoope_count = 0; // количество жизней
      var gamePlayed = false; // статус игры
      
      var speed = 0; // скрость уровня
      var speedDrakon = 0; //  скрость падения дракона
      var accelerationDrakon = 0; // ускорение падения
      
      
      
      // обработчки кнопок основные
      btnTapGame.addEventListener("click", handleTapGame);
      ekranOne.btn_gameplay.addEventListener("click", handle_btn_gameplay);
      ekranLegal.btn_gameplay_soglasie.addEventListener("click", handle_btn_gameplay_soglasie);
      ekranFin.btn_repeat.addEventListener("click", handle_btn_repeat);
      
      createjs.Ticker.addEventListener('tick', handleTick);
      stage.enableMouseOver(3);
      
      
      
      // сохраняем имя игроков
      ekranFin.user1.username.text = window.MCUser.user1.firstName + ' ' + window.MCUser.user1.lastName;
      ekranFin.user1.point.text = '0';
      
      // запрашиваем данные соперника
      getUser2data();
      
      
      function StartLevel1(){
        scoope.gotoAndStop(0);
        scoope_count = 0;
        scoope_point = 0;	
        level_count = 0;
        speed = -1.8;
      
        drakonResetSpeed();
      
        
        barrier = _this.gameMain.game.barrier1;
        barrier_img = _this.gameMain.game.barrier_img1;
      
        barrier.x = 0;	
        barrier_img.x = 0;
        level.x = 0;
        level.gotoAndStop(0);
        
        gameMain.visible = true;
        ekranFin.visible = false;
        ekranLegal.visible = false;	
        
        plashka_info.gotoAndStop('rules');
        
        scoope_point_text.text = '0';
        resetPrizStatus();
      
        // запрашиваем максимальные очки
        api_getPoints('max', window.MCUser.user1.id);
      }
      
      // установка начальной скорости дракона
      function drakonResetSpeed(){
        speedDrakon = 1;
        accelerationDrakon = 1.05;
        drakon.y = 600;
      }
      
      var jump = false;
      
      // rules - показываем плашку приветсвие
      // plays - идет игра
      // two_life - показываем плашку осталось 2 жизни
      // one_life - показываем плашку осталась 1 жизнь
      // next_level - показываем плашку следующий уровень 
      
      
      
      function handleTapGame(e){
          // анимация прыганья дракона по тапу
          if (jump==false && drakon.y > 400 && gamePlayed==true) {
            jump = true;
            speedDrakon = -12;
            accelerationDrakon = 0.92; //1.09;
            setTimeout(function(){
              speedDrakon = 1;
              accelerationDrakon = 1.04;
              //console.log('speedDrakon='+speedDrakon +' _this.drakon.y='+drakon.y);	
              jump = false;
            },300);
          } else {
          /// вывод плашек
            gamePlayed = true;
            plashka_info.gotoAndStop('plays');
          }
      }
      
      
      function nextLevelStart(){
      
        gamePlayed = false;
        plashka_info.gotoAndStop('next_level');
        audioWin();	
        
        drakonResetSpeed();
        
        level_count++;
        switch(level_count) {
          case 0:
            barrier = _this.gameMain.game.barrier1;
            barrier_img = _this.gameMain.game.barrier_img1;
            level.gotoAndStop(0);
            speed = -1.8;
            break;
          case 1:
            barrier = _this.gameMain.game.barrier2;
            barrier_img = _this.gameMain.game.barrier_img2;
            level.gotoAndStop(1);
            speed = -3;
            ym(95511895,'reachGoal','Level2');
            break;
          case 2:
            barrier = _this.gameMain.game.barrier3;
            barrier_img = _this.gameMain.game.barrier_img3;
            level.gotoAndStop(2);
            speed = -6;
            ym(95511895,'reachGoal','Level3');
            break;
          case 3:	
            ym(95511895,'reachGoal','gameFinish');
            proigral();
            break;
        }	
      
        btnPause();
        
        barrier.x = 0;	
        barrier_img.x = 0;
        level.x = 0;	
        resetPrizStatus();
      }
      
      
      function resetPrizStatus(){
        let pr = barrier.children; 
        for (let i = 0; i < pr.length; i++) {
          if (pr[i].priz==undefined ){
            pr[i].alpha = 0;
          } else {
            if (pr[i].vkl==false){
              pr[i].vkl == true;
              pr[i].gotoAndStop(0);
              pr[i].alpha = 1;
              } 
          }
        }	
      }
      
      function handleTick(event) {
        
        if (gamePlayed == true) {
          // местоположение дракона + корректировка формы
          let d = drakon;	
          let dX = d.x + d.nominalBounds.width/2 - 20;
          let dY = d.y + d.nominalBounds.height/2 - 22;
          let dW = d.nominalBounds.width - 150;
          let dH = d.nominalBounds.height - 40;
          
          let ch = 0;
      
          //  контейнер со списоком всех обектов препятствий
          let pr = barrier.children; 
          
          // проверяем положение дракона и препятсвия 
          for (let i = 0; i < pr.length; i++) {
            let p = pr[i].getTransformedBounds();
            let pX = p.x + barrier.x;
            let pY = p.y;
            let pH = p.height;
            let pW = p.width;			
            
            
            // проверяем, есть есть колизия - выполняем		
            if (dX > pX && (dX-dW) < (pX+pW) && dY > pY && (dY-dH) < (pY+pH) ) {
            //	_this.ttx.text = 	"БарьерХ=" + pX + " ДраконХ=" + dX +
            //						"БарьерY=" + pY + " ДраконY=" + dY;
              // проверяем во что врезались, если есть очки - это приз
              if (pr[i].priz==undefined ){
                vrezalsay();
              } else {
                if (pr[i].vkl==true){
                  schitem_ochki(pr[i].priz);
                  pr[i].vkl=false;
                  pr[i].play();
                  audioPriz();
                } 
              }
            }
          }	
        }
      }
      
      function vrezalsay(){
        gamePlayed = false;
        scoope_count += 1;
        scoope.gotoAndStop(scoope_count);
        audioLooser();
      
        drakonResetSpeed();
        
        if (scoope_count==1){
          plashka_info.gotoAndStop('two_life');
        }
        if (scoope_count==2){
          plashka_info.gotoAndStop('one_life');
          // вечная жизнь
        //	scoope_count = 0;
        //	scoope.gotoAndStop(scoope_count);
        //	plashka_info.gotoAndStop('two_life');
      
        }
        //  кончились жизни
        if (scoope_count >= 3) {
          plashka_info.gotoAndStop('plays');
          proigral();
        }
        
        btnPause();
      
      }
      
      
      function schitem_ochki(i){
        scoope_point += i;
        scoope_point_text.text = ''+scoope_point;
        ekranFin.user1.point.text = scoope_point;
      }
      
      
      
      function animate() {
          requestAnimationFrame(animate);
      
        const dlinna = [-4650, -5450, -6450];
        
        if (gamePlayed == true) {
          // остановка и переключение уровня
          if (barrier.x < dlinna[level_count]) { 
            nextLevelStart();
          }
      
          // движение уровня
          barrier.x += speed;	
          barrier_img.x +=speed;
          level.x += speed/2;	
          
          // падение дракона
          drakon.y += speedDrakon;
          accelerationDrakon -= .00002;
          speedDrakon = speedDrakon * accelerationDrakon;
          if (speedDrakon>10) {speedDrakon=10;}
      
          // упал = проиграл
          if (drakon.y > 1200) {
            vrezalsay(); 
          }
        }
      
      }
      
      animate();
      
      
      
      
