      function handle_btn_gameplay(){
        ym(95511895,'reachGoal','starGame');
        if (window.MCUser.user1.acceptedRules==false) {
          ekranOne.visible = false;	
          ekranLegal.visible = true;
        } else {
          ekranOne.visible = false;	
          gameMain.visible = true;
          StartLevel1();
        }
      }
      
      
      
      
      
      
      function proigral(){
        // повторный запрос данных второго юзера
        getUser2data();
        
        //  сохраняем на сервак	
        api_setPoints(scoope_point, window.MCUser.user1.id, window.MCUser.user1.chatInstance);
        window.MCUser.user1.gameLastPoint = scoope_point;
        
        // если подписан на бота, выключаем блок подписки
        if (window.MCUser.user1.botSubscription==true) {ekranFin.block_podpishisy.visible = false;}	
      
        // сравниваем максимальное количество очков
        console.log('maxPoint=' + window.MCUser.user1.gameMaxPoint + ' Текущие очки=' + scoope_point);
        
        if (scoope_point >= 100) {
          // Если набрал больше 100 баллов
          ekranFin.Head_Text.gotoAndStop(2); // Отличный результат, ты — участник розыгрыша! 
        } else {
          // Если набрал меньше 100 баллов
          if (window.MCUser.user1.gameMaxPoint<=100) { 
            // и не участвуешь в розыгрыше
            ekranFin.Head_Text.gotoAndStop(0); // Ура! до 100 баллов осталось совсем чуть-чуть! сыграем еще?
          } else{
            // и участвуешь в розыгрыше
            ekranFin.Head_Text.gotoAndStop(1); // Ты набрал меньше 100 баллов. Не переживай — ты уже участвуешь в розыгрыше!
          }		
        }
      
      
        // включаем финальный экран
        ekranFin.visible = true;
        gameMain.visible = false;
        
        btnPause();
      }
      
      
